import React, {useState} from 'react';
import { StyleSheet, View, Text } from 'react-native';
import { NumberKeyboard } from '../../../components';

export default function SecondsInput() {
    const [seconds, setSeconds] = useState('00');

    const format = v => {
        return seconds.split('').push(v.toString()).slice(-2).join()
    }
    return (
        <View>
            <Text>WOrk</Text>
            <View style={styles.minSec}>
                <Text style={styles.minSecText}>
                    Min Sec
                </Text>
            </View>
            <View style={styles.sec}>
                <Text style={styles.secText}>
                    00 —Å
                </Text>
            </View>
            <NumberKeyboard onKeyPress={(v) => setSeconds(format(v))}/>
        </View>
    )
}
const styles = StyleSheet.create({})
